import {FORM_CHECK_BOX_1,FORM_BTN,FO} from "../../Utilities/textForApp";
import Button from "../../components/UI/Button/Button";
import CheckBox from "../../components/UI/Button/UI/CheckBox";
import { useState } from "react";
import UserDetails from "./UserDetailsForm/UserDetailsForm";

const FormPage = () => {
  const [agreeIsChecked, setAgreeIsChecked] = useState(false);
  const [intrestedIsChecked, setIntrestedIsChecked] = useState(true);

  const onSubmit = () => {};

  const checkBoxes = (
    <>
      <CheckBox
        name="agree"
        label={texts.FORM_CHECK_BOX_1}
        isSelected={agreeIsChecked}
        onCheckboxChange={() => setAgreeIsChecked(!agreeIsChecked)}
      />
      <CheckBox
        name="intrested"
        label={texts.FORM_CHECK_BOX_2}
        isSelected={intrestedIsChecked}
        onCheckboxChange={() => setIntrestedIsChecked(!intrestedIsChecked)}
      />
    </>
  );

  let vv = FORM_BTN;
  return (
    <div className="formPage">
      <h2>{texts.FORM_H2}</h2>
      <form>
        <div className="textInputs">
          <UserDetails/>
        </div>
        <div className="checkBoxes">
          {checkBoxes}
          <Button text={texts.vv} clicked={onSubmit} type="send" />
        </div>
      </form>
    </div>
  );
};

export default FormPage;
